const Index = props => {
  return (
    <div>
      <Head>
        <title>Todo-list App</title>
        <link
          rel="stylesheet"
          href="https://bootswatch.com/4/cerulean/bootstrap.min.css"
        />
      </Head>
      <div className="container">{props.children}</div>
    </div>
  );
};

export default Index;
